[[package]]
name = "argcomplete"
version = "1.12.1"
description = "Bash tab completion for argparse"
category = "main"
optional = false
python-versions = "*"

[package.extras]
test = ["coverage", "flake8", "pexpect", "wheel"]

[[package]]
name = "aws-psycopg2"
version = "1.2.1"
description = "A aws psycopg2 package from psycopg2."
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "boto3"
version = "1.15.13"
description = "The AWS SDK for Python"
category = "main"
optional = false
python-versions = "*"

[package.dependencies]
botocore = ">=1.18.13,<1.19.0"
jmespath = ">=0.7.1,<1.0.0"
s3transfer = ">=0.3.0,<0.4.0"

