version = "1.15.13.0"
description = "Type annotations for boto3 1.15.13, generated by mypy-boto3-buider 3.2.0"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
typing-extensions = {version = "*", markers = "python_version < \"3.8\""}

